    modifier lockSwap {
        _inSwap = true;
        _;
        _inSwap = false;
    }

    uint256 public constant MAX_SUPPLY = uint248(1e14 ether);

    uint256 public constant AMOUNT_DAO = MAX_SUPPLY / 100 * 30;
    uint256 public constant AMOUNT_LP = MAX_SUPPLY / 100 * 20;

